:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,0,0,0,0,0,'textpic','Die Vergangenheit erhalten - Die Zukunft gestalten','left','<p>Die Firma Wittemaier Bau GmbH wurde 1925 von Georg Wittemaier in Mannheim gegründet.</p>\r\n<p>Gertrud Wittemaier, eine Tochter des Firmengründers, und ihr Ehemann Jakob Höring übernahmen später die Führung des Betriebes.&nbsp;</p>\r\n<p>Mittlerweile arbeitet mit den Brüdern Georg und Peter Höring schon die dritte Generation im Hause Wittemaier.&nbsp;</p>\r\n<p>Durch diese lange Tradition und die Zusammenarbeit mit zahlreichen Auftraggebern aus dem öffentlichen und privaten Sektor entwickelten sich unsere Kompetenz und Erfahrung in verschiedenen Bereichen der Baubranche mit den dazugehörigen Dienstleistungen.</p>\r\n<p>Da wir unser Unternehmen als traditionsbewussten Familienbetrieb verstehen und uns gleichzeitig für seine zeitgemäße Weiterentwicklung engagieren, arbeiten wir heute mit bewährten Methoden und moderner Technik.</p>\r\n<p>Wir wollen stets noch besser werden.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,0,'','','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(6,'',7,1590082283,1590081035,1,1,0,0,0,'',256,0,0,0,0,NULL,0,_binary 'a:22:{s:5:\"CType\";N;s: