r Ehemann Jakob Höring übernahmen später die Führung des Betriebes.&nbsp;</p>\r\n<p>Mittlerweile arbeitet mit den Brüdern Georg und Peter Höring schon die dritte Generation im Hause Wittemaier.&nbsp;</p>\r\n<p>Durch diese lange Tradition und die Zusammenarbeit mit zahlreichen Auftraggebern aus dem öffentlichen und privaten Sektor entwickelten sich unsere Kompetenz und Erfahrung in verschiedenen Bereichen der Baubranche mit den dazugehörigen Dienstleistungen.</p>\r\n<blockquote><p>Da wir unser Unternehmen als traditionsbewussten Familienbetrieb verstehen und uns gleichzeitig für seine zeitgemäße Weiterentwicklung engagieren, arbeiten wir heute mit bewährten Methoden und moderner Technik.</p></blockquote>',0,0,0,0,1,0,126,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,'1','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,0,NULL,'','','','default','','','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(13,'',1,1601455445,1590089549,1,0,0,0,0,'',560,0,0,0,0,NULL,0,_binary 'a:32:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:5:\"image\";N;s:11:\"file_folder\";N;s:16:\"filelink_sorting\";N;s:11:\"imageorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,0,0,0,0,0,'textpic','Unsere Philosophie','','<blockquote><p>Wohnen und Arbeiten in einer angenehmen und der Gesundheit förderlichen Umgebung gehört zu den Grundbedürfnissen unserer Gesellschaft.</p></blockquote>\r\n<p>Daher benutzen wir bei unserer Auftragsausführung gerne natürliche und umweltfreundliche Materialien. Das kommt den Menschen zu Gute.</p>\r\n<p>Ob Altbau oder Neubau - wir setzen uns als Innungsfachbetrieb fachlich fundiert und professionell für Ihre Bauvorhaben ein. Das machen wir auch gewerkeübergreifend, da wir in der Handwerksrolle&nbsp;für die Gewerke: Gipser/Stuckateur, Maler und Maurer/Betonbauer eingetragen sind.</p>\r\n<p>Solide Arbeit und eine umweltgerechte Umsetzung Ihrer Wünsche sind&nbsp;unsere Zielvorgaben.&nbsp;Das hat auch gute Gründe, denn gute Planung gepaart mit Qualitätsarbeit und Einsatz hochwertiger Materialien führen auf Dauer zu Kosteneinsparung und nachhaltiger Freude am Gebäude.&nbsp;Ihre langfristige&nbsp;Zufriedenheit ist die Basis unseres Erfolges.</p>\r\n<p>Selbstverständlich freut sich unser gut ausgebildetes Team auf Ihre Anfrage und berät Sie gerne - individuell und kreativ - ganz nach Ihren Vorstellungen auch durch unsere vereidigten und geprüften Sachverständige.</p>',0,0,0,0,1,0,125,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,'1','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,0,NULL,'','','','default','','','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\