<ul> 	<li>verputzen Wände im Innen- und Außenbereich,&nbsp;</li> 	<li>stellen Leichtbauwände und abgehängte Decken aus Gipskartonplatten (Trockenbau) und Rabitz her,&nbsp;</li> 	<li>Altbausanierung und Restaurierung,&nbsp;</li> 	<li>ein weiteres wichtiges Arbeitsfeld ist die Wärmedämmung von Gebäuden, zum Beispiel mit Wärmedämmverbundsystemen&nbsp;</li> 	<li>und vieles mehr</li> </ul>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,30,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(71,'',5,1602158002,1600618034,1,1,0,0,0,'',32,0,0,0,0,NULL,0,'',0,0,0,0,0,0,0,'panel','','','<h4>Arbeitsmittel:&nbsp;</h4>\r\n<p>Zu den Hauptarbeitsmitteln des Stuckateurs zählen: Glättkelle, Kelle, Stuckateureisen, Trapezlatte, Vorziehlatte, Blechschere, Wasserwaage, Senklot, Richtlatte und eine Verputzmaschine/Mischpumpe für den maschinellen Putzauftrag&nbsp;</p>\r\n<p>Als&nbsp;<strong>Arbeitsstoffe</strong>&nbsp;zählen: Gips-, Kalk-, Kalk-Zement-, Zement- und Lehmputze aber auch Gipskartonplatten, Estriche, Dämmungen u.v.m.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,31,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0