INSERT INTO `tx_bootstrappackage_icon_group_item` VALUES (1,1,1602198076,1590087596,1,0,0,0,0,1,0,0,_binary 'a:1:{s:6:\"hidden\";N;}',0,0,0,0,0,0,0,0,NULL,11,'Über uns','','<p>Als traditionsbewussten Familienbetrieb engagieren wir uns für eine zeitgemäße Weiterentwicklung und&nbsp;arbeiten heute mit bewährten Methoden und moderner Technik.</p>','t3://page?uid=1#12',1,0,''),(2,1,1602198076,1590087750,1,0,0,0,0,2,0,0,_binary 'a:1:{s:6:\"hidden\";N;}',0,0,0,0,0,0,0,0,NULL,11,'Kontaktieren Sie uns!','','<p>Unser gut ausgebildetes Team freut sich auf Ihre Anfrage und berät Sie gerne - individuell und kreativ - ganz nach Ihren Vorstellungen auch durch unsere vereidigten und geprüften Sachverständige.</p>','t3://page?uid=1#14',1,0,''),(3,1,1602198076,1590088425,1,0,0,0,0,3,0,0,_binary 'a:9:{s:6:\"header\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:4:\"link\";N;s:9:\"icon_file\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,11,'Bewerben Sie sich!','','<p>Sie möchten sich bei uns initiativ bewerben oder interessieren sich für eines unserer Stellenangebote?&nbsp;</p>\r\n<p>Dann bewerben Sie sich schnell und unkompliziert über unser Kurzbewerbungsformular.</p>','t3://page?uid=7',1,0,''),(4,1,1590702681,1590616715,1,0,0,0,0,1,0,0,_binary 'a:9:{s:6:\"header\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:4:\"link\";N;s:9:\"icon_file\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,58,'Wittemaier Bau GmbH','','<p>Marconistrasse 17-21 &nbsp;·&nbsp; D-68309 Mannheim &nbsp;·&nbsp; Gewerbegebiet Mannheim-Käfertal&nbsp;</p>','t3://page?uid=1#59',1,0,''),(5,1,1590702681,1590617132,1,0,0,0,0,2,0,0,_binary 'a:9:{s:6:\"header\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:4:\"link\";N;s:9:\"icon_file\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,58,'Kontakt','','<p>Wir stehen Ihnen bei allen Fragen gerne zu