INSERT INTO `tx_bootstrappackage_tab_item` VALUES (1,9,1590420057,1590419629,1,1,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,18,'Und es hält und hält und hält','<p>Ganzheitliches Sanierungskonzept erstellen.&nbsp;</p>\r\n<p>Auswahl des geeigneten mineralischen Grundputzes mit Oberputz in Filztechnik auf Mauerwerk mit unterschiedlichem physikalischem Verhalten, Sandsteinfreilegung im Naßstrahlgutverfahren, Restaurierung sämtlicher Sandsteinteile einschließlich mehrfarbiger Aderung, Restaurierung der Zierfriese aus Terrakotta sowie Herstellung neuer Terrakottaornamente mit Hilfe von Silikonkautschukabgüssen.&nbsp;</p>\r\n<p>Hydrophobierung der Sandsteinteile und farbliche Gestaltung der Fassade, Arbeits- und Schutzgerüste erstellt, Dachdecker-, Spengler- und Schlosserarbeiten als Generalunternehmerleistung.</p>\r\n\r\n',0,'left',2,0,0,''),(2,10,1590439457,1590420187,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,20,'Stuck, Stuckmarmor u.a.','<p>Herstellen des Wand- und Deckenputzes, Herstellen der Profilschablonen, des Zugschlittens, der Führungen und sonstiger Hilfsmittel.&nbsp;</p>\r\n<p>Anfertigen des Stuckgesimses im Nasszugverfahren einschließlich Ausbilden von positiven und negativen Gesimsecken (Verkröpfungen), Herstellen der Stuckleisten und Ansetzen an die Decke, Deckenband und Deckenspiegel farblich absetzen.</p>',1,'left',2,1,0,''),(3,9,1590514725,1590420374,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,22,'Innen- und Außenputze jeder Art, historische Putze, Laboruntersuchungen','<p>Ganzheitliches Sanierungskonzept erstellen.&nbsp;</p>\r\n<p>Auswahl des geeigneten mineralischen Grundputzes mit Oberputz in Filztechnik auf Mauerwerk mit unterschiedlichem physikalischem Verhalten, Sandsteinfreilegung im Naßstrahlgutverfahren, Restaurierung sämtlicher Sandsteinteile einschließlich mehrfarbiger Aderung, Restaurierung der Zierfriese aus Terrakotta sowie Herstellung neuer Terrakottaornamente mit Hilfe von Silikonkautschukabgüssen.&nbsp;</p>\r\n<p>Hydrophobierung der Sandsteinteile und farbliche Gestaltung der Fassade, Arbeits- und Schutzgerüste erstellt, Dachdecker-, Spengler- und Schlosserarbeiten als Generalunternehmerleistung.</p>',1,'left',2,1,0,''),(4,11,1590440038,1590421874,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,24,'Brand- und Schallschutz, Dachausbau, nicht tragende Wände aus Gipskarton oder Gipsbauplatten (Gipsdielen) u.v.m.','<p>Herstellen sämtlicher abgehängter Decken, nicht tragende Trennwände erstellt, Brandschutzmaßnahmen durchgeführt, Gipskartonverkleidungen hergestellt, Ausführung sämtlicher Gipser- und Stuckateurarbeiten.</p>',1,'left',2,1,0,''),(5,12,1590509738,1590422001,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,27,'Sandsteinrestaurierung Gelber, roter und Buntsandstein','<p>Sanierungs- und Restaurierungskonzept erstellt, nach labor-technischer Untersuchung Hydrophobiermittel festgelegt.</p>\r\n<p>Natursteinrestaurierung sowie Sandsteinverfugungen neu hergestellt, Steinmetz-, Stuckateur- und Malerarbeiten.</p>',1,'left',2,1,0,''),(6,13,1590510967,1590422111,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,29,'Sandstrahlen, Steinsanierung und -ersatz, Mauerwerksverfugung','<p>Sanierungsarbeiten an historischer Wehrturmanlage „Aulturm“ in Worms Pfeddersheim, beschädigtes Mauerwerk ausgebaut und neu aufgemauert, beschädigte Fensterstürze aus Bruchsteinmauerwerk erneuert.&nbsp;</p>\r\n<p>Auskratzen des lockeren Fugenmörtels, Herstellen einer neuen Außenverfugung mit einem natürlich hydraulisch gebundenen Kalkmörtel im Trockenspritzverfahren.&nbsp;</p>\r\n<p>Der Fugenmörtel war mit roten und gelben Sanden auf die Farbigkeit des historischen Materials eingefärbt.</p>',1,'left',3,1,0,''),(7,14,1590512897,1590422607,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,31,'Wärmedämmung für innen und außen:','\r\n<ul> 	<li>Neubau oder Altbau&nbsp;</li> 	<li>Aufdopplung</li> 	<li>Rückbau</li> 	<li>Ökologische Baustoffe</li> 	<li>Denkmalschutz</li> </ul>\r\n<p>Aufbringen eines Wärmedämmverbundsystemes aus Steinwolleplatten, Gestalten der Fassade mit mineralisch gebundenem Oberputz.</p>',1,'left',2,1,0,''),(8,15,1590513141,1590422734,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,33,'Balkonsanierung aus einer Hand, Rissverpressung, Spritzbeton','<p>Schadhafte Betonteile entfernt, Betonoberflächen gereinigt, Armierungseisen auf statische Relevanz geprüft und vor Korrosion geschützt, Ausbrüche mit auf Untergrund abgestimmtem Sanierungsmörtel restauriert, Aufbringen von elastischen Beschichtungen, Aufbringen eines von Kohlendioxid- und Schwefeldioxid-Einflüssen schützenden Farbanstrichs.</p>',1,'left',2,1,0,''),(9,16,1590566965,1590422917,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,35,'Sachverständige Beratung','<p>Eine detaillierte Bestandsanalyse gibt Planungssicherheit und ist für eine fundierte Schadensdiagnose unerlässlich.</p>\r\n<p>Erkennen der Schadenursachen.</p>\r\n<p>Ausschließen nicht notwendiger und nicht sinnvoller Maßnahmen.</p>',1,'left',2,0,0,''),(10,17,1590442130,1590423122,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,37,'Mauer- und Betonarbeiten, Estriche, Pflasterarbeiten, Gerüstbau, Farbkonzepte','<p>Erstellung von Schutz-, Arbeits- und Abrissgerüsten, Abriß diverser Bauteile, Erstellung von Mauerwerk, Stahlbetonbalkonen und anderen Bauteilen.</p>',1,'left',2,1,0,''),(11,17,1590442130,1590423122,1,0,0,0,0,2,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,37,'Beschichtungen, Algen- und Schimmelpilzbeseitigung, Brandschadensanierung','<p>Abfangungen mit Stahlträgern, feuchte Wände saniert, abgehängte Decken montiert, Innenputzarbeiten, Verbesserung des Wärmschutzes durch Anbringen von Verbundplatten mit Dampfsperre und vieles mehr.</p>',1,'left',2,1,0,''),(12,18,1590511843,1590437467,1,0,0,0,0,1,0,0,_binary 'a:10:{s:6:\"header\";N;s:8:\"bodytext\";N;s:5:\"media\";N;s:11:\"mediaorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,0,0,0,0,0,NULL,40,'Kellersanierung, Vertikal- und Horizontalisolierung, Sanierputze, Labor, Gutachten','<p>Mauerwerksdiagnostik mit Feststellung des Lastfalles, Einbringen einer Horizontalsperre mit Mehrstufeninjektion im Niederdruckverfahren, hierfür Bohrlöcher im Abstand von 12 cm Achsmaß bohren und im Druckverfahren mit Injektionsgut verfüllen, Einbringen einer sulfatbeständigen, mineralischen Grundverkieselung und einer Dichtspachtel, Auftragen von Sulfatexschlämme in mehreren Arbeitsgängen, Liefern und Einbringen eines Sanierputzsystems in mehreren Lagen.</p>',1,'left',2,1,0,'');
