INSERT INTO `tx_bwjobs_domain_model_job` VALUES (1,26,1602150754,1602062715,1,1,0,0,0,256,0,0,NULL,_binary 'a:26:{s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:5:\"title\";N;s:4:\"slug\";N;s:6:\"teaser\";N;s:10:\"work_hours\";N;s:9:\"job_start\";N;s:13:\"valid_through\";N;s:11:\"data_posted\";N;s:8:\"location\";N;s:8:\"job_type\";N;s:11:\"description\";N;s:8:\"benefits\";N;s:22:\"education_requirements\";N;s:23:\"experience_requirements\";N;s:14:\"qualifications\";N;s:16:\"responsibilities\";N;s:6:\"skills\";N;s:18:\"special_commitment\";N;s:11:\"show_salary\";N;s:8:\"currency\";N;s:6:\"salary\";N;s:5:\"cycle\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:10:\"categories\";N;}',0,0,0,0,0,0,0,'Stuckateure (m/w)','stuckateure-mw','<p>mit Berufserfahrung und Führerschein.</p>','<h1>Stuckateure und Gipser</h1>\r\n<ul> 	<li>verputzen Wände im Innen- und Außenbereich,&nbsp;</li> 	<li>stellen Leichtbauwände und abgehängte Decken aus Gipskartonplatten (Trockenbau) und Rabitz her,&nbsp;</li> 	<li>Altbausanierung und Restaurierung,&nbsp;</li> 	<li>ein weiteres wichtiges Arbeitsfeld ist die Wärmedämmung von Gebäuden, zum Beispiel mit Wärmedämmverbundsystemen&nbsp;</li> 	<li>und vieles mehr</li> </ul>','','','<ul> 	<li>Berufserfahrung und Führerschein.</li> </ul>','','','','',0,1602062145,1602062145,1,1,0,'',0,'HOUR',1602062145,0),(2,26,1602158540,1602066390,1,0,0,0,0,128,0,0,NULL,_binary 'a:26:{s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:5:\"title\";N;s:4:\"slug\";N;s:6:\"teaser\";N;s:10:\"work_hours\";N;s:9:\"job_start\";N;s:13:\"valid_through\";N;s:11:\"data_posted\";N;s:8:\"location\";N;s:8:\"job_type\";N;s:11:\"description\";N;s:8:\"benefits\";N;s:22:\"education_requirements\";N;s:23:\"experience_requirements\";N;s:14:\"qualifications\";N;s:16:\"responsibilities\";N;s:6:\"skills\";N;s:18:\"special_commitment\";N;s:11:\"show_salary\";N;s:8:\"currency\";N;s:6:\"salary\";N;s:5:\"cycle\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:10:\"categories\";N;}',0,0,0,0,0,0,0,'Auszubild